import React from 'react';
import './App.css';
import Blog from './modules/Blog'

const user=React.useState('')

let blogs =[
    {title:"Mun eka Blogi",
    author:"Jaska Jokunen",
    url:"www.jaskajokunen.fi"
  }
]



function App() {
  if (user === null) {
    return (
      <div>
        <h2>Log in to application</h2>
        <form>
          //...
        </form>
      </div>
    )
  }

  return (
    <div>
      <h2>blogs</h2>
      {blogs.map(blog =>
        <Blog key={blog.id} blog={blog} />
      )}
    </div>
  )
}

export default App;
